import React from 'react';
import styles from './Navbar.module.css';


function navbar() {
    return (
        <div className={styles.navbar}>
            <ul>
                <li>Users</li>
                <li>Posts</li>
                <li>Products</li>
            </ul>
        </div>
    )
}

export default navbar;
